#=============================================================================================================
#
#	dic_route_test.sh [int]
#
#	tests every basic route the system. The program sends the route commands directly to
#	DI&C, instead of RouteValidation, in this way, we can set all basic routes, both 
#	preferred and alternate.
#
#	The program get the status of tracks, points, and signals from RailwayStateManager,
#	and if it finds any thing not as expected, it will reports the error.
#
#	arguments:
#		int .............. the interlocking name
#
#	note:
#		1. 	if not argument is specified, then all routes for every interlocking
#			will be tested
#		2.	if the interlocking name is given, then all routes in the 
#			interlocking will be tested
#		3. 	if the interlocking name is incorrect, no routes will be tested.
#
#	Good luck!
#
#	This program is generated by "bridge.jar" by Hlee
#	Date: Wed 8/Jun/2011
#
#=============================================================================================================

